func TestDeduplicate(t *testing.T) {
	t.Parallel()

	cases := []struct {
		got  static.Path
		want static.Path
		name string
	}{
		{
			static.Path{},
			static.Path{},
			"empty",
		},
		{
			static.Path{{1, true}},
			static.Path{{1, true}},
			"one element",
		},
		{
			static.Path{{1, true}, {2, false}, {2, true}},
			static.Path{{1, true}, {2, true}},
			"same steps at the end with true last Step",
		},
		{
			static.Path{{1, true}, {2, false}, {2, false}},
			static.Path{{1, true}, {2, false}},
			"same steps at the end with false last Step",
		},
		{
			static.Path{{1, true}, {2, true}, {2, false}},
			static.Path{{1, true}, {2, true}},
			"same steps at the end with true Step",
		},
		{
			static.Path{{1, true}, {2, true}, {2, false}, {3, false}},
			static.Path{{1, true}, {2, true}, {3, false}},
			"same steps at the middle",
		},
		{
			static.Path{{1, true}, {2, false}, {2, true}, {2, false}, {3, false}},
			static.Path{{1, true}, {2, true}, {3, false}},
			"same steps at the middle, true in the middle",
		},
		{
			static.Path{{2, true}, {2, false}, {1, true}},
			static.Path{{2, true}, {1, true}},
			"same steps at the start",
		},
		{
			static.Path{{1, true}, {1, false}, {0, true}, {2, true}, {2, false}, {0, true}, {3, false}, {3, false}},
			static.Path{{1, true}, {0, true}, {2, true}, {0, true}, {3, false}},
			"same steps at the start, middle, end",
		},
		{
			static.Path{{3734, false}, {3742, true}, {3795, true}, {3795, false}},
			static.Path{{3734, false}, {3742, true}, {3795, true}},
			"same steps at the end, true is not at the end",
		},
	}

	for _, c := range cases {
		c := c
		t.Run(c.name, func(t *testing.T) {
			c.got.Deduplicate()
			if len(c.want) != len(c.got) {
				t.Fatalf("decuplication went wrong.\nGot:\t%v\nWant:\t%v\n", c.got, c.want)
			}
		})
	}
}

