func PrintPathBytes(script []byte, path static.Path) error {
	m := make(map[uint64]string) // position to representation

	it := asm.NewInstructionIterator(script)
	var s string
	for it.Next() {
		if it.Arg() != nil && 0 < len(it.Arg()) {
			s = fmt.Sprintf("%05x: %v 0x%x\n", it.PC(), it.Op(), it.Arg())
		} else {
			s = fmt.Sprintf("%05x: %v\n", it.PC(), it.Op())
		}

		m[it.PC()] = s
	}

	for _, step := range path {
		if s, ok := m[uint64(step.JumpPC)]; ok {
			fmt.Println(s)
		} else {
			fmt.Println("cant find the step", step)
		}
	}

	return it.Error()
}